import React from 'react';
import Header_main from './components/Header_main'
import News_header from './components/News_header';

function App() {
  return (
    <main className='Main'>
      <aside>
        <Header_main/>
      </aside>
      <div class="content">
        <News_header/>
        
      </div>  
    </main>
  );
  
}

export default App;
